import Friend from "./Friend";
import StoreContext from "../../../StoreContext";

function FriendContainer() {
    return(
        <StoreContext.Consumer>
            {(store) => {
                return <Friend state={store.getState()}/>
            }}
        </StoreContext.Consumer>
    );
}

export default FriendContainer;
